import React,{Component} from 'react'
import Typography from '@material-ui/core/Typography'
import './../images/tr_green.svg'
import green1 from './../images/tr_green.svg'
import green2 from './../images/bl_green.svg'
import C2CLogo from './c2clogo.js'
import Button from '@material-ui/core/Button'
import TextField from '@material-ui/core/TextField';
import ExpansionPanel from '@material-ui/core/ExpansionPanel';
import ExpansionPanelSummary from '@material-ui/core/ExpansionPanelSummary';
import ExpansionPanelDetails from '@material-ui/core/ExpansionPanelDetails';
import ExpandMoreIcon from '@material-ui/icons/ExpandMore';

class TeamEval extends Component{
    render(){
        let team_members=['shivank','aditya','akshit']
        return(
            <div className="team_eval_div">
                <img className="green1" src={green1} />
                <img className="green2" src={green2} />

                <C2CLogo />

                <div className="team_details">
                    <Typography component="p" className="team_name">Pi and Sigma</Typography>
                    {
                        team_members.map((val,ind)=>(
                            <Typography component="p" className="team_member_name">{val}</Typography>
                        ))
                    }
                </div>

            </div>
        )
    }
}

export default TeamEval
